import React from "react";
import Input from "./Input";

function Form(props) {
    return (
        <form className="form">
            <Input
                type="text"
                placeholder="Username"
            />
            <Input
                type="password"
                placeholder="password"
            />
            <Input
                type="password"
                placeholder="confirm password"
            />
            <button type="submit"> 
                {props.userIsRegistered ? "Login" : "Register"}
            </button>
        </form>
    )
}

export default Form;
